import Card from "../Card/Card";

import ColumnPopup from './ColumnPopup';


const Column = ({onAddColumn}) => {
     
  
  return (
    <>
      <div className="container bg-primary">
        <Card></Card>
        <Card></Card>
        <Card></Card>
      </div>
    </>
  );
};

export default Column;
